import React, { Fragment, userState } from 'react';

const Profile = () => {
  console.log('profile');
  return (
    <Fragment>
      <div className="right_content card">
        <p>팔로우</p>
        <p>팔로잉</p>
      </div>
      <style jsx>
        {`
          .right_content{
            float:left;
            width:30%;
            height:500px;
            background-color:white;
          }
        `}
      </style>
    </Fragment>
  );
};

export default Profile;
